hebsuperobject.biblemap.put("b26_5_1", new hebsuperobject(26,5,1,"ואתה בן אדם קח לך חרב חדה תער הגלבים תקחנה לך והעברת על ראשך ועל זקנך ולקחת לך מאזני משקל וחלקתם׃"));
hebsuperobject.biblemap.put("b26_5_2", new hebsuperobject(26,5,2,"שלשית באור תבעיר בתוך העיר כמלאת ימי המצור ולקחת את השלשית תכה בחרב סביבותיה והשלשית תזרה לרוח וחרב אריק אחריהם׃"));
hebsuperobject.biblemap.put("b26_5_3", new hebsuperobject(26,5,3,"ולקחת משם מעט במספר וצרת אותם בכנפיך׃"));
hebsuperobject.biblemap.put("b26_5_4", new hebsuperobject(26,5,4,"ומהם עוד תקח והשלכת אותם אל תוך האש ושרפת אתם באש ממנו תצא אש אל כל בית ישראל׃"));
hebsuperobject.biblemap.put("b26_5_5", new hebsuperobject(26,5,5,"כה אמר אדני יהוה זאת ירושלם בתוך הגוים שמתיה וסביבותיה ארצות׃"));
hebsuperobject.biblemap.put("b26_5_6", new hebsuperobject(26,5,6,"ותמר את משפטי לרשעה מן הגוים ואת חקותי מן הארצות אשר סביבותיה כי במשפטי מאסו וחקותי לא הלכו בהם׃"));
hebsuperobject.biblemap.put("b26_5_7", new hebsuperobject(26,5,7,"לכן כה אמר אדני יהוה יען המנכם מן הגוים אשר סביבותיכם בחקותי לא הלכתם ואת משפטי לא עשיתם וכמשפטי הגוים אשר סביבותיכם לא עשיתם׃"));
hebsuperobject.biblemap.put("b26_5_8", new hebsuperobject(26,5,8,"לכן כה אמר אדני יהוה הנני עליך גם אני ועשיתי בתוכך משפטים לעיני הגוים׃"));
hebsuperobject.biblemap.put("b26_5_9", new hebsuperobject(26,5,9,"ועשיתי בך את אשר לא עשיתי ואת אשר לא אעשה כמהו עוד יען כל תועבתיך׃"));
hebsuperobject.biblemap.put("b26_5_10", new hebsuperobject(26,5,10,"לכן אבות יאכלו בנים בתוכך ובנים יאכלו אבותם ועשיתי בך שפטים וזריתי את כל שאריתך לכל רוח׃"));
hebsuperobject.biblemap.put("b26_5_11", new hebsuperobject(26,5,11,"לכן חי אני נאם אדני יהוה אם לא יען את מקדשי טמאת בכל שקוציך ובכל תועבתיך וגם אני אגרע ולא תחוס עיני וגם אני לא אחמול׃"));
hebsuperobject.biblemap.put("b26_5_12", new hebsuperobject(26,5,12,"שלשתיך בדבר ימותו וברעב יכלו בתוכך והשלשית בחרב יפלו סביבותיך והשלישית לכל רוח אזרה וחרב אריק אחריהם׃"));
hebsuperobject.biblemap.put("b26_5_13", new hebsuperobject(26,5,13,"וכלה אפי והנחותי חמתי בם והנחמתי וידעו כי אני יהוה דברתי בקנאתי בכלותי חמתי בם׃"));
hebsuperobject.biblemap.put("b26_5_14", new hebsuperobject(26,5,14,"ואתנך לחרבה ולחרפה בגוים אשר סביבותיך לעיני כל עובר׃"));
hebsuperobject.biblemap.put("b26_5_15", new hebsuperobject(26,5,15,"והיתה חרפה וגדופה מוסר ומשמה לגוים אשר סביבותיך בעשותי בך שפטים באף ובחמה ובתכחות חמה אני יהוה דברתי׃"));
hebsuperobject.biblemap.put("b26_5_16", new hebsuperobject(26,5,16,"בשלחי את חצי הרעב הרעים בהם אשר היו למשחית אשר אשלח אותם לשחתכם ורעב אסף עליכם ושברתי לכם מטה לחם׃"));
hebsuperobject.biblemap.put("b26_5_17", new hebsuperobject(26,5,17,"ושלחתי עליכם רעב וחיה רעה ושכלך ודבר ודם יעבר בך וחרב אביא עליך אני יהוה דברתי׃"));
hebsuperobject.biblemap.put("b26_6_1", new hebsuperobject(26,6,1,"ויהי דבר יהוה אלי לאמר׃"));
hebsuperobject.biblemap.put("b26_6_2", new hebsuperobject(26,6,2,"בן אדם שים פניך אל הרי ישראל והנבא אליהם׃"));
hebsuperobject.biblemap.put("b26_6_3", new hebsuperobject(26,6,3,"ואמרת הרי ישראל שמעו דבר אדני יהוה כה אמר אדני יהוה להרים ולגבעות לאפיקים ולגאית הנני אני מביא עליכם חרב ואבדתי במותיכם׃"));
hebsuperobject.biblemap.put("b26_6_4", new hebsuperobject(26,6,4,"ונשמו מזבחותיכם ונשברו חמניכם והפלתי חלליכם לפני גלוליכם׃"));
hebsuperobject.biblemap.put("b26_6_5", new hebsuperobject(26,6,5,"ונתתי את פגרי בני ישראל לפני גלוליהם וזריתי את עצמותיכם סביבות מזבחותיכם׃"));
hebsuperobject.biblemap.put("b26_6_6", new hebsuperobject(26,6,6,"בכל מושבותיכם הערים תחרבנה והבמות תישמנה למען יחרבו ויאשמו מזבחותיכם ונשברו ונשבתו גלוליכם ונגדעו חמניכם ונמחו מעשיכם׃"));
hebsuperobject.biblemap.put("b26_6_7", new hebsuperobject(26,6,7,"ונפל חלל בתוככם וידעתם כי אני יהוה׃"));
hebsuperobject.biblemap.put("b26_6_8", new hebsuperobject(26,6,8,"והותרתי בהיות לכם פליטי חרב בגוים בהזרותיכם בארצות׃"));
hebsuperobject.biblemap.put("b26_6_9", new hebsuperobject(26,6,9,"וזכרו פליטיכם אותי בגוים אשר נשבו שם אשר נשברתי את לבם הזונה אשר סר מעלי ואת עיניהם הזנות אחרי גלוליהם ונקטו בפניהם אל הרעות אשר עשו לכל תועבתיהם׃"));
hebsuperobject.biblemap.put("b26_6_10", new hebsuperobject(26,6,10,"וידעו כי אני יהוה לא אל חנם דברתי לעשות להם הרעה הזאת׃"));
hebsuperobject.biblemap.put("b26_6_11", new hebsuperobject(26,6,11,"כה אמר אדני יהוה הכה בכפך ורקע ברגלך ואמר אח אל כל תועבות רעות בית ישראל אשר בחרב ברעב ובדבר יפלו׃"));
hebsuperobject.biblemap.put("b26_6_12", new hebsuperobject(26,6,12,"הרחוק בדבר ימות והקרוב בחרב יפול והנשאר והנצור ברעב ימות וכליתי חמתי בם׃"));
hebsuperobject.biblemap.put("b26_6_13", new hebsuperobject(26,6,13,"וידעתם כי אני יהוה בהיות חלליהם בתוך גלוליהם סביבות מזבחותיהם אל כל גבעה רמה בכל ראשי ההרים ותחת כל עץ רענן ותחת כל אלה עבתה מקום אשר נתנו שם ריח ניחח לכל גלוליהם׃"));
hebsuperobject.biblemap.put("b26_6_14", new hebsuperobject(26,6,14,"ונטיתי את ידי עליהם ונתתי את הארץ שממה ומשמה ממדבר דבלתה בכל מושבותיהם וידעו כי אני יהוה׃"));
hebsuperobject.biblemap.put("b26_7_1", new hebsuperobject(26,7,1,"ויהי דבר יהוה אלי לאמר׃"));
hebsuperobject.biblemap.put("b26_7_2", new hebsuperobject(26,7,2,"ואתה בן אדם כה אמר אדני יהוה לאדמת ישראל קץ בא הקץ על ארבעת כנפות הארץ׃"));
hebsuperobject.biblemap.put("b26_7_3", new hebsuperobject(26,7,3,"עתה הקץ עליך ושלחתי אפי בך ושפטתיך כדרכיך ונתתי עליך את כל תועבתיך׃"));
hebsuperobject.biblemap.put("b26_7_4", new hebsuperobject(26,7,4,"ולא תחוס עיני עליך ולא אחמול כי דרכיך עליך אתן ותועבותיך בתוכך תהיין וידעתם כי אני יהוה׃"));
hebsuperobject.biblemap.put("b26_7_5", new hebsuperobject(26,7,5,"כה אמר אדני יהוה רעה אחת רעה הנה באה׃"));
hebsuperobject.biblemap.put("b26_7_6", new hebsuperobject(26,7,6,"קץ בא בא הקץ הקיץ אליך הנה באה׃"));
hebsuperobject.biblemap.put("b26_7_7", new hebsuperobject(26,7,7,"באה הצפירה אליך יושב הארץ בא העת קרוב היום מהומה ולא הד הרים׃"));
hebsuperobject.biblemap.put("b26_7_8", new hebsuperobject(26,7,8,"עתה מקרוב אשפוך חמתי עליך וכליתי אפי בך ושפטתיך כדרכיך ונתתי עליך את כל תועבותיך׃"));
hebsuperobject.biblemap.put("b26_7_9", new hebsuperobject(26,7,9,"ולא תחוס עיני ולא אחמול כדרכיך עליך אתן ותועבותיך בתוכך תהיין וידעתם כי אני יהוה מכה׃"));
hebsuperobject.biblemap.put("b26_7_10", new hebsuperobject(26,7,10,"הנה היום הנה באה יצאה הצפרה צץ המטה פרח הזדון׃"));
hebsuperobject.biblemap.put("b26_7_11", new hebsuperobject(26,7,11,"החמס קם למטה רשע לא מהם ולא מהמונם ולא מהמהם ולא נה בהם׃"));
hebsuperobject.biblemap.put("b26_7_12", new hebsuperobject(26,7,12,"בא העת הגיע היום הקונה אל ישמח והמוכר אל יתאבל כי חרון אל כל המונה׃"));
hebsuperobject.biblemap.put("b26_7_13", new hebsuperobject(26,7,13,"כי המוכר אל הממכר לא ישוב ועוד בחיים חיתם כי חזון אל כל המונה לא ישוב ואיש בעונו חיתו לא יתחזקו׃"));
hebsuperobject.biblemap.put("b26_7_14", new hebsuperobject(26,7,14,"תקעו בתקוע והכין הכל ואין הלך למלחמה כי חרוני אל כל המונה׃"));
hebsuperobject.biblemap.put("b26_7_15", new hebsuperobject(26,7,15,"החרב בחוץ והדבר והרעב מבית אשר בשדה בחרב ימות ואשר בעיר רעב ודבר יאכלנו׃"));
hebsuperobject.biblemap.put("b26_7_16", new hebsuperobject(26,7,16,"ופלטו פליטיהם והיו אל ההרים כיוני הגאיות כלם המות איש בעונו׃"));
hebsuperobject.biblemap.put("b26_7_17", new hebsuperobject(26,7,17,"כל הידים תרפינה וכל ברכים תלכנה מים׃"));
hebsuperobject.biblemap.put("b26_7_18", new hebsuperobject(26,7,18,"וחגרו שקים וכסתה אותם פלצות ואל כל פנים בושה ובכל ראשיהם קרחה׃"));
hebsuperobject.biblemap.put("b26_7_19", new hebsuperobject(26,7,19,"כספם בחוצות ישליכו וזהבם לנדה יהיה כספם וזהבם לא יוכל להצילם ביום עברת יהוה נפשם לא ישבעו ומעיהם לא ימלאו כי מכשול עונם היה׃"));
hebsuperobject.biblemap.put("b26_7_20", new hebsuperobject(26,7,20,"וצבי עדיו לגאון שמהו וצלמי תועבתם שקוציהם עשו בו על כן נתתיו להם לנדה׃"));
hebsuperobject.biblemap.put("b26_7_21", new hebsuperobject(26,7,21,"ונתתיו ביד הזרים לבז ולרשעי הארץ לשלל וחללה׃"));
hebsuperobject.biblemap.put("b26_7_22", new hebsuperobject(26,7,22,"והסבותי פני מהם וחללו את צפוני ובאו בה פריצים וחללוה׃"));
hebsuperobject.biblemap.put("b26_7_23", new hebsuperobject(26,7,23,"עשה הרתוק כי הארץ מלאה משפט דמים והעיר מלאה חמס׃"));
hebsuperobject.biblemap.put("b26_7_24", new hebsuperobject(26,7,24,"והבאתי רעי גוים וירשו את בתיהם והשבתי גאון עזים ונחלו מקדשיהם׃"));
hebsuperobject.biblemap.put("b26_7_25", new hebsuperobject(26,7,25,"קפדה בא ובקשו שלום ואין׃"));
hebsuperobject.biblemap.put("b26_7_26", new hebsuperobject(26,7,26,"הוה על הוה תבוא ושמעה אל שמועה תהיה ובקשו חזון מנביא ותורה תאבד מכהן ועצה מזקנים׃"));
hebsuperobject.biblemap.put("b26_7_27", new hebsuperobject(26,7,27,"המלך יתאבל ונשיא ילבש שממה וידי עם הארץ תבהלנה מדרכם אעשה אותם ובמשפטיהם אשפטם וידעו כי אני יהוה׃"));
hebsuperobject.biblemap.put("b26_8_1", new hebsuperobject(26,8,1,"ויהי בשנה הששית בששי בחמשה לחדש אני יושב בביתי וזקני יהודה יושבים לפני ותפל עלי שם יד אדני יהוה׃"));
hebsuperobject.biblemap.put("b26_8_2", new hebsuperobject(26,8,2,"ואראה והנה דמות כמראה אש ממראה מתניו ולמטה אש וממתניו ולמעלה כמראה זהר כעין החשמלה׃"));
hebsuperobject.biblemap.put("b26_8_3", new hebsuperobject(26,8,3,"וישלח תבנית יד ויקחני בציצת ראשי ותשא אתי רוח בין הארץ ובין השמים ותבא אתי ירושלמה במראות אלהים אל פתח שער הפנימית הפונה צפונה אשר שם מושב סמל הקנאה המקנה׃"));
hebsuperobject.biblemap.put("b26_8_4", new hebsuperobject(26,8,4,"והנה שם כבוד אלהי ישראל כמראה אשר ראיתי בבקעה׃"));
hebsuperobject.biblemap.put("b26_8_5", new hebsuperobject(26,8,5,"ויאמר אלי בן אדם שא נא עיניך דרך צפונה ואשא עיני דרך צפונה והנה מצפון לשער המזבח סמל הקנאה הזה בבאה׃"));
hebsuperobject.biblemap.put("b26_8_6", new hebsuperobject(26,8,6,"ויאמר אלי בן אדם הראה אתה מהם עשים תועבות גדלות אשר בית ישראל עשים פה לרחקה מעל מקדשי ועוד תשוב תראה תועבות גדלות׃"));
hebsuperobject.biblemap.put("b26_8_7", new hebsuperobject(26,8,7,"ויבא אתי אל פתח החצר ואראה והנה חר אחד בקיר׃"));
hebsuperobject.biblemap.put("b26_8_8", new hebsuperobject(26,8,8,"ויאמר אלי בן אדם חתר נא בקיר ואחתר בקיר והנה פתח אחד׃"));
hebsuperobject.biblemap.put("b26_8_9", new hebsuperobject(26,8,9,"ויאמר אלי בא וראה את התועבות הרעות אשר הם עשים פה׃"));
hebsuperobject.biblemap.put("b26_8_10", new hebsuperobject(26,8,10,"ואבוא ואראה והנה כל תבנית רמש ובהמה שקץ וכל גלולי בית ישראל מחקה על הקיר סביב סביב׃"));
hebsuperobject.biblemap.put("b26_8_11", new hebsuperobject(26,8,11,"ושבעים איש מזקני בית ישראל ויאזניהו בן שפן עמד בתוכם עמדים לפניהם ואיש מקטרתו בידו ועתר ענן הקטרת עלה׃"));
hebsuperobject.biblemap.put("b26_8_12", new hebsuperobject(26,8,12,"ויאמר אלי הראית בן אדם אשר זקני בית ישראל עשים בחשך איש בחדרי משכיתו כי אמרים אין יהוה ראה אתנו עזב יהוה את הארץ׃"));
hebsuperobject.biblemap.put("b26_8_13", new hebsuperobject(26,8,13,"ויאמר אלי עוד תשוב תראה תועבות גדלות אשר המה עשים׃"));
hebsuperobject.biblemap.put("b26_8_14", new hebsuperobject(26,8,14,"ויבא אתי אל פתח שער בית יהוה אשר אל הצפונה והנה שם הנשים ישבות מבכות את התמוז׃"));
hebsuperobject.biblemap.put("b26_8_15", new hebsuperobject(26,8,15,"ויאמר אלי הראית בן אדם עוד תשוב תראה תועבות גדלות מאלה׃"));
hebsuperobject.biblemap.put("b26_8_16", new hebsuperobject(26,8,16,"ויבא אתי אל חצר בית יהוה הפנימית והנה פתח היכל יהוה בין האולם ובין המזבח כעשרים וחמשה איש אחריהם אל היכל יהוה ופניהם קדמה והמה משתחויתם קדמה לשמש׃"));
hebsuperobject.biblemap.put("b26_8_17", new hebsuperobject(26,8,17,"ויאמר אלי הראית בן אדם הנקל לבית יהודה מעשות את התועבות אשר עשו פה כי מלאו את הארץ חמס וישבו להכעיסני והנם שלחים את הזמורה אל אפם׃"));
hebsuperobject.biblemap.put("b26_8_18", new hebsuperobject(26,8,18,"וגם אני אעשה בחמה לא תחוס עיני ולא אחמל וקראו באזני קול גדול ולא אשמע אותם׃"));
hebsuperobject.biblemap.put("b26_9_1", new hebsuperobject(26,9,1,"ויקרא באזני קול גדול לאמר קרבו פקדות העיר ואיש כלי משחתו בידו׃"));
hebsuperobject.biblemap.put("b26_9_2", new hebsuperobject(26,9,2,"והנה ששה אנשים באים מדרך שער העליון אשר מפנה צפונה ואיש כלי מפצו בידו ואיש אחד בתוכם לבש בדים וקסת הספר במתניו ויבאו ויעמדו אצל מזבח הנחשת׃"));
hebsuperobject.biblemap.put("b26_9_3", new hebsuperobject(26,9,3,"וכבוד אלהי ישראל נעלה מעל הכרוב אשר היה עליו אל מפתן הבית ויקרא אל האיש הלבש הבדים אשר קסת הספר במתניו׃"));
hebsuperobject.biblemap.put("b26_9_4", new hebsuperobject(26,9,4,"ויאמר יהוה אלו עבר בתוך העיר בתוך ירושלם והתוית תו על מצחות האנשים הנאנחים והנאנקים על כל התועבות הנעשות בתוכה׃"));
hebsuperobject.biblemap.put("b26_9_5", new hebsuperobject(26,9,5,"ולאלה אמר באזני עברו בעיר אחריו והכו על תחס עיניכם ואל תחמלו׃"));
hebsuperobject.biblemap.put("b26_9_6", new hebsuperobject(26,9,6,"זקן בחור ובתולה וטף ונשים תהרגו למשחית ועל כל איש אשר עליו התו אל תגשו וממקדשי תחלו ויחלו באנשים הזקנים אשר לפני הבית׃"));
hebsuperobject.biblemap.put("b26_9_7", new hebsuperobject(26,9,7,"ויאמר אליהם טמאו את הבית ומלאו את החצרות חללים צאו ויצאו והכו בעיר׃"));
hebsuperobject.biblemap.put("b26_9_8", new hebsuperobject(26,9,8,"ויהי כהכותם ונאשאר אני ואפלה על פני ואזעק ואמר אהה אדני יהוה המשחית אתה את כל שארית ישראל בשפכך את חמתך על ירושלם׃"));
hebsuperobject.biblemap.put("b26_9_9", new hebsuperobject(26,9,9,"ויאמר אלי עון בית ישראל ויהודה גדול במאד מאד ותמלא הארץ דמים והעיר מלאה מטה כי אמרו עזב יהוה את הארץ ואין יהוה ראה׃"));
hebsuperobject.biblemap.put("b26_9_10", new hebsuperobject(26,9,10,"וגם אני לא תחוס עיני ולא אחמל דרכם בראשם נתתי׃"));
hebsuperobject.biblemap.put("b26_9_11", new hebsuperobject(26,9,11,"והנה האיש לבש הבדים אשר הקסת במתניו משיב דבר לאמר עשיתי כאשר צויתני׃"));
hebsuperobject.biblemap.put("b26_10_1", new hebsuperobject(26,10,1,"ואראה והנה אל הרקיע אשר על ראש הכרבים כאבן ספיר כמראה דמות כסא נראה עליהם׃"));
hebsuperobject.biblemap.put("b26_10_2", new hebsuperobject(26,10,2,"ויאמר אל האיש לבש הבדים ויאמר בא אל בינות לגלגל אל תחת לכרוב ומלא חפניך גחלי אש מבינות לכרבים וזרק על העיר ויבא לעיני׃"));
hebsuperobject.biblemap.put("b26_10_3", new hebsuperobject(26,10,3,"והכרבים עמדים מימין לבית בבאו האיש והענן מלא את החצר הפנימית׃"));
hebsuperobject.biblemap.put("b26_10_4", new hebsuperobject(26,10,4,"וירם כבוד יהוה מעל הכרוב על מפתן הבית וימלא הבית את הענן והחצר מלאה את נגה כבוד יהוה׃"));
hebsuperobject.biblemap.put("b26_10_5", new hebsuperobject(26,10,5,"וקול כנפי הכרובים נשמע עד החצר החיצנה כקול אל שדי בדברו׃"));
hebsuperobject.biblemap.put("b26_10_6", new hebsuperobject(26,10,6,"ויהי בצותו את האיש לבש הבדים לאמר קח אש מבינות לגלגל מבינות לכרובים ויבא ויעמד אצל האופן׃"));
hebsuperobject.biblemap.put("b26_10_7", new hebsuperobject(26,10,7,"וישלח הכרוב את ידו מבינות לכרובים אל האש אשר בינות הכרבים וישא ויתן אל חפני לבש הבדים ויקח ויצא׃"));
hebsuperobject.biblemap.put("b26_10_8", new hebsuperobject(26,10,8,"וירא לכרבים תבנית יד אדם תחת כנפיהם׃"));
hebsuperobject.biblemap.put("b26_10_9", new hebsuperobject(26,10,9,"ואראה והנה ארבעה אופנים אצל הכרובים אופן אחד אצל הכרוב אחד ואופן אחד אצל הכרוב אחד ומראה האופנים כעין אבן תרשיש׃"));
hebsuperobject.biblemap.put("b26_10_10", new hebsuperobject(26,10,10,"ומראיהם דמות אחד לארבעתם כאשר יהיה האופן בתוך האופן׃"));
hebsuperobject.biblemap.put("b26_10_11", new hebsuperobject(26,10,11,"בלכתם אל ארבעת רבעיהם ילכו לא יסבו בלכתם כי המקום אשר יפנה הראש אחריו ילכו לא יסבו בלכתם׃"));
hebsuperobject.biblemap.put("b26_10_12", new hebsuperobject(26,10,12,"וכל בשרם וגבהם וידיהם וכנפיהם והאופנים מלאים עינים סביב לארבעתם אופניהם׃"));
hebsuperobject.biblemap.put("b26_10_13", new hebsuperobject(26,10,13,"לאופנים להם קורא הגלגל באזני׃"));
hebsuperobject.biblemap.put("b26_10_14", new hebsuperobject(26,10,14,"וארבעה פנים לאחד פני האחד פני הכרוב ופני השני פני אדם והשלישי פני אריה והרביעי פני נשר׃"));
hebsuperobject.biblemap.put("b26_10_15", new hebsuperobject(26,10,15,"וירמו הכרובים היא החיה אשר ראיתי בנהר כבר׃"));
hebsuperobject.biblemap.put("b26_10_16", new hebsuperobject(26,10,16,"ובלכת הכרובים ילכו האופנים אצלם ובשאת הכרובים את כנפיהם לרום מעל הארץ לא יסבו האופנים גם הם מאצלם׃"));
hebsuperobject.biblemap.put("b26_10_17", new hebsuperobject(26,10,17,"בעמדם יעמדו וברומם ירומו אותם כי רוח החיה בהם׃"));
hebsuperobject.biblemap.put("b26_10_18", new hebsuperobject(26,10,18,"ויצא כבוד יהוה מעל מפתן הבית ויעמד על הכרובים׃"));
hebsuperobject.biblemap.put("b26_10_19", new hebsuperobject(26,10,19,"וישאו הכרובים את כנפיהם וירומו מן הארץ לעיני בצאתם והאופנים לעמתם ויעמד פתח שער בית יהוה הקדמוני וכבוד אלהי ישראל עליהם מלמעלה׃"));
hebsuperobject.biblemap.put("b26_10_20", new hebsuperobject(26,10,20,"היא החיה אשר ראיתי תחת אלהי ישראל בנהר כבר ואדע כי כרובים המה׃"));
hebsuperobject.biblemap.put("b26_10_21", new hebsuperobject(26,10,21,"ארבעה ארבעה פנים לאחד וארבע כנפים לאחד ודמות ידי אדם תחת כנפיהם׃"));
hebsuperobject.biblemap.put("b26_10_22", new hebsuperobject(26,10,22,"ודמות פניהם המה הפנים אשר ראיתי על נהר כבר מראיהם ואותם איש אל עבר פניו ילכו׃"));
hebsuperobject.biblemap.put("b26_11_1", new hebsuperobject(26,11,1,"ותשא אתי רוח ותבא אתי אל שער בית יהוה הקדמוני הפונה קדימה והנה בפתח השער עשרים וחמשה איש ואראה בתוכם את יאזניה בן עזר ואת פלטיהו בן בניהו שרי העם׃"));
hebsuperobject.biblemap.put("b26_11_2", new hebsuperobject(26,11,2,"ויאמר אלי בן אדם אלה האנשים החשבים און והיעצים עצת רע בעיר הזאת׃"));
hebsuperobject.biblemap.put("b26_11_3", new hebsuperobject(26,11,3,"האמרים לא בקרוב בנות בתים היא הסיר ואנחנו הבשר׃"));
hebsuperobject.biblemap.put("b26_11_4", new hebsuperobject(26,11,4,"לכן הנבא עליהם הנבא בן אדם׃"));
hebsuperobject.biblemap.put("b26_11_5", new hebsuperobject(26,11,5,"ותפל עלי רוח יהוה ויאמר אלי אמר כה אמר יהוה כן אמרתם בית ישראל ומעלות רוחכם אני ידעתיה׃"));
hebsuperobject.biblemap.put("b26_11_6", new hebsuperobject(26,11,6,"הרביתם חלליכם בעיר הזאת ומלאתם חוצתיה חלל׃"));
hebsuperobject.biblemap.put("b26_11_7", new hebsuperobject(26,11,7,"לכן כה אמר אדני יהוה חלליכם אשר שמתם בתוכה המה הבשר והיא הסיר ואתכם הוציא מתוכה׃"));
hebsuperobject.biblemap.put("b26_11_8", new hebsuperobject(26,11,8,"חרב יראתם וחרב אביא עליכם נאם אדני יהוה׃"));
hebsuperobject.biblemap.put("b26_11_9", new hebsuperobject(26,11,9,"והוצאתי אתכם מתוכה ונתתי אתכם ביד זרים ועשיתי בכם שפטים׃"));
hebsuperobject.biblemap.put("b26_11_10", new hebsuperobject(26,11,10,"בחרב תפלו על גבול ישראל אשפוט אתכם וידעתם כי אני יהוה׃"));
hebsuperobject.biblemap.put("b26_11_11", new hebsuperobject(26,11,11,"היא לא תהיה לכם לסיר ואתם תהיו בתוכה לבשר אל גבול ישראל אשפט אתכם׃"));
hebsuperobject.biblemap.put("b26_11_12", new hebsuperobject(26,11,12,"וידעתם כי אני יהוה אשר בחקי לא הלכתם ומשפטי לא עשיתם וכמשפטי הגוים אשר סביבותיכם עשיתם׃"));
hebsuperobject.biblemap.put("b26_11_13", new hebsuperobject(26,11,13,"ויהי כהנבאי ופלטיהו בן בניה מת ואפל על פני ואזעק קול גדול ואמר אהה אדני יהוה כלה אתה עשה את שארית ישראל׃"));
hebsuperobject.biblemap.put("b26_11_14", new hebsuperobject(26,11,14,"ויהי דבר יהוה אלי לאמר׃"));
hebsuperobject.biblemap.put("b26_11_15", new hebsuperobject(26,11,15,"בן אדם אחיך אחיך אנשי גאלתך וכל בית ישראל כלה אשר אמרו להם ישבי ירושלם רחקו מעל יהוה לנו היא נתנה הארץ למורשה׃"));
hebsuperobject.biblemap.put("b26_11_16", new hebsuperobject(26,11,16,"לכן אמר כה אמר אדני יהוה כי הרחקתים בגוים וכי הפיצותים בארצות ואהי להם למקדש מעט בארצות אשר באו שם׃"));
hebsuperobject.biblemap.put("b26_11_17", new hebsuperobject(26,11,17,"לכן אמר כה אמר אדני יהוה וקבצתי אתכם מן העמים ואספתי אתכם מן הארצות אשר נפצותם בהם ונתתי לכם את אדמת ישראל׃"));
hebsuperobject.biblemap.put("b26_11_18", new hebsuperobject(26,11,18,"ובאו שמה והסירו את כל שקוציה ואת כל תועבתיה ממנה׃"));
hebsuperobject.biblemap.put("b26_11_19", new hebsuperobject(26,11,19,"וננתי להם לב אחד ורוח חדשה אתן בקרבכם והסרתי לב האבן מבשרם ונתתי להם לב בשר׃"));
hebsuperobject.biblemap.put("b26_11_20", new hebsuperobject(26,11,20,"למען בחקתי ילכו ואת משפטי ישמרו ועשו אתם והיו לי לעם ואני אהיה להם לאלהים׃"));
hebsuperobject.biblemap.put("b26_11_21", new hebsuperobject(26,11,21,"ואל לב שקוציהם ותועבותיהם לבם הלך דרכם בראשם נתתי נאם אדני יהוה׃"));
hebsuperobject.biblemap.put("b26_11_22", new hebsuperobject(26,11,22,"וישאו הכרובים את כנפיהם והאופנים לעמתם וכבוד אלהי ישראל עליהם מלמעלה׃"));
hebsuperobject.biblemap.put("b26_11_23", new hebsuperobject(26,11,23,"ויעל כבוד יהוה מעל תוך העיר ויעמד על ההר אשר מקדם לעיר׃"));
hebsuperobject.biblemap.put("b26_11_24", new hebsuperobject(26,11,24,"ורוח נשאתני ותבאני כשדימה אל הגולה במראה ברוח אלהים ויעל מעלי המראה אשר ראיתי׃"));
hebsuperobject.biblemap.put("b26_11_25", new hebsuperobject(26,11,25,"ואדבר אל הגולה את כל דברי יהוה אשר הראני׃"));
hebsuperobject.biblemap.put("b26_12_1", new hebsuperobject(26,12,1,"ויהי דבר יהוה אלי לאמר׃"));
hebsuperobject.biblemap.put("b26_12_2", new hebsuperobject(26,12,2,"בן אדם בתוך בית המרי אתה ישב אשר עינים להם לראות ולא ראו אזנים להם לשמע ולא שמעו כי בית מרי הם׃"));
hebsuperobject.biblemap.put("b26_12_3", new hebsuperobject(26,12,3,"ואתה בן אדם עשה לך כלי גולה וגלה יומם לעיניהם וגלית ממקומך אל מקום אחר לעיניהם אולי יראו כי בית מרי המה׃"));
hebsuperobject.biblemap.put("b26_12_4", new hebsuperobject(26,12,4,"והוצאת כליך ככלי גולה יומם לעיניהם ואתה תצא בערב לעיניהם כמוצאי גולה׃"));
hebsuperobject.biblemap.put("b26_12_5", new hebsuperobject(26,12,5,"לעיניהם חתר לך בקיר והוצאת בו׃"));
hebsuperobject.biblemap.put("b26_12_6", new hebsuperobject(26,12,6,"לעיניהם על כתף תשא בעלטה תוציא פניך תכסה ולא תראה את הארץ כי מופת נתתיך לבית ישראל׃"));
hebsuperobject.biblemap.put("b26_12_7", new hebsuperobject(26,12,7,"ואעש כן כאשר צויתי כלי הוצאתי ככלי גולה יומם ובערב חתרתי לי בקיר ביד בעלטה הוצאתי על כתף נשאתי לעיניהם׃"));
hebsuperobject.biblemap.put("b26_12_8", new hebsuperobject(26,12,8,"ויהי דבר יהוה אלי בבקר לאמר׃"));
hebsuperobject.biblemap.put("b26_12_9", new hebsuperobject(26,12,9,"בן אדם הלא אמרו אליך בית ישראל בית המרי מה אתה עשה׃"));
hebsuperobject.biblemap.put("b26_12_10", new hebsuperobject(26,12,10,"אמר אליהם כה אמר אדני יהוה הנשיא המשא הזה בירושלם וכל בית ישראל אשר המה בתוכם׃"));
hebsuperobject.biblemap.put("b26_12_11", new hebsuperobject(26,12,11,"אמר אני מופתכם כאשר עשיתי כן יעשה להם בגולה בשבי ילכו׃"));
hebsuperobject.biblemap.put("b26_12_12", new hebsuperobject(26,12,12,"והנשיא אשר בתוכם אל כתף ישא בעלטה ויצא בקיר יחתרו להוציא בו פניו יכסה יען אשר לא יראה לעין הוא את הארץ׃"));
hebsuperobject.biblemap.put("b26_12_13", new hebsuperobject(26,12,13,"ופרשתי את רשתי עליו ונתפש במצודתי והבאתי אתו בבלה ארץ כשדים ואותה לא יראה ושם ימות׃"));
hebsuperobject.biblemap.put("b26_12_14", new hebsuperobject(26,12,14,"וכל אשר סביבתיו עזרה וכל אגפיו אזרה לכל רוח וחרב אריק אחריהם׃"));
hebsuperobject.biblemap.put("b26_12_15", new hebsuperobject(26,12,15,"וידעו כי אני יהוה בהפיצי אותם בגוים וזריתי אותם בארצות׃"));
hebsuperobject.biblemap.put("b26_12_16", new hebsuperobject(26,12,16,"והותרתי מהם אנשי מספר מחרב מרעב ומדבר למען יספרו את כל תועבותיהם בגוים אשר באו שם וידעו כי אני יהוה׃"));
hebsuperobject.biblemap.put("b26_12_17", new hebsuperobject(26,12,17,"ויהי דבר יהוה אלי לאמר׃"));
hebsuperobject.biblemap.put("b26_12_18", new hebsuperobject(26,12,18,"בן אדם לחמך ברעש תאכל ומימיך ברגזה ובדאגה תשתה׃"));
hebsuperobject.biblemap.put("b26_12_19", new hebsuperobject(26,12,19,"ואמרת אל עם הארץ כה אמר אדני יהוה ליושבי ירושלם אל אדמת ישראל לחמם בדאגה יאכלו ומימיהם בשממון ישתו למען תשם ארצה ממלאה מחמס כל הישבים בה׃"));
hebsuperobject.biblemap.put("b26_12_20", new hebsuperobject(26,12,20,"והערים הנושבות תחרבנה והארץ שממה תהיה וידעתם כי אני יהוה׃"));
hebsuperobject.biblemap.put("b26_12_21", new hebsuperobject(26,12,21,"ויהי דבר יהוה אלי לאמר׃"));
hebsuperobject.biblemap.put("b26_12_22", new hebsuperobject(26,12,22,"בן אדם מה המשל הזה לכם על אדמת ישראל לאמר יארכו הימים ואבד כל חזון׃"));
hebsuperobject.biblemap.put("b26_12_23", new hebsuperobject(26,12,23,"לכן אמר אליהם כה אמר אדני יהוה השבתי את המשל הזה ולא ימשלו אתו עוד בישראל כי אם דבר אליהם קרבו הימים ודבר כל חזון׃"));
hebsuperobject.biblemap.put("b26_12_24", new hebsuperobject(26,12,24,"כי לא יהיה עוד כל חזון שוא ומקסם חלק בתוך בית ישראל׃"));
