hebsuperobject.biblemap.put("b26_12_28", new hebsuperobject(26,12,28,"לכן אמר אליהם כה אמר אדני יהוה לא תמשך עוד כל דברי אשר אדבר דבר ויעשה נאם אדני יהוה׃"));
hebsuperobject.biblemap.put("b26_13_1", new hebsuperobject(26,13,1,"ויהי דבר יהוה אלי לאמר׃"));
hebsuperobject.biblemap.put("b26_13_2", new hebsuperobject(26,13,2,"בן אדם הנבא אל נביאי ישראל הנבאים ואמרת לנביאי מלבם שמעו דבר יהוה׃"));
hebsuperobject.biblemap.put("b26_13_3", new hebsuperobject(26,13,3,"כה אמר אדני יהוה הוי על הנביאים הנבלים אשר הלכים אחר רוחם ולבלתי ראו׃"));
