hebsuperobject.biblemap.put("b26_13_8", new hebsuperobject(26,13,8,"לכן כה אמר אדני יהוה יען דברכם שוא וחזיתם כזב לכן הנני אליכם נאם אדני יהוה׃"));
hebsuperobject.biblemap.put("b26_13_9", new hebsuperobject(26,13,9,"והיתה ידי אל הנביאים החזים שוא והקסמים כזב בסוד עמי לא יהיו ובכתב בית ישראל לא יכתבו ואל אדמת ישראל לא יבאו וידעתם כי אני אדני יהוה׃"));
hebsuperobject.biblemap.put("b26_13_10", new hebsuperobject(26,13,10,"יען וביען הטעו את עמי לאמר שלום ואין שלום והוא בנה חיץ והנם טחים אתו תפל׃"));
hebsuperobject.biblemap.put("b26_13_11", new hebsuperobject(26,13,11,"אמר אל טחי תפל ויפל היה גשם שוטף ואתנה אבני אלגביש תפלנה ורוח סערות תבקע׃"));
hebsuperobject.biblemap.put("b26_13_12", new hebsuperobject(26,13,12,"והנה נפל הקיר הלוא יאמר אליכם איה הטיח אשר טחתם׃"));
