hebsuperobject.biblemap.put("b26_13_14", new hebsuperobject(26,13,14,"והרסתי את הקיר אשר טחתם תפל והגעתיהו אל הארץ ונגלה יסדו ונפלה וכליתם בתוכה וידעתם כי אני יהוה׃"));
hebsuperobject.biblemap.put("b26_13_15", new hebsuperobject(26,13,15,"וכליתי את חמתי בקיר ובטחים אתו תפל ואמר לכם אין הקיר ואין הטחים אתו׃"));
hebsuperobject.biblemap.put("b26_13_16", new hebsuperobject(26,13,16,"נביאי ישראל הנבאים אל ירושלם והחזים לה חזון שלם ואין שלם נאם אדני יהוה׃"));
hebsuperobject.biblemap.put("b26_13_17", new hebsuperobject(26,13,17,"ואתה בן אדם שים פניך אל בנות עמך המתנבאות מלבהן והנבא עליהן׃"));
