hebsuperobject.biblemap.put("b26_13_19", new hebsuperobject(26,13,19,"ותחללנה אתי אל עמי בשעלי שערים ובפתותי לחם להמית נפשות אשר לא תמותנה ולחיות נפשות אשר לא תחיינה בכזבכם לעמי שמעי כזב׃"));
hebsuperobject.biblemap.put("b26_13_20", new hebsuperobject(26,13,20,"לכן כה אמר אדני יהוה הנני אל כסתותיכנה אשר אתנה מצדדות שם את הנפשות לפרחות וקרעתי אתם מעל זרועתיכם ושלחתי את הנפשות אשר אתם מצדדות את נפשים לפרחת׃"));
hebsuperobject.biblemap.put("b26_13_21", new hebsuperobject(26,13,21,"וקרעתי את מספחתיכם והצלתי את עמי מידכן ולא יהיו עוד בידכן למצודה וידעתן כי אני יהוה׃"));
hebsuperobject.biblemap.put("b26_13_22", new hebsuperobject(26,13,22,"יען הכאות לב צדיק שקר ואני לא הכאבתיו ולחזק ידי רשע לבלתי שוב מדרכו הרע להחיתו׃"));
hebsuperobject.biblemap.put("b26_13_23", new hebsuperobject(26,13,23,"לכן שוא לא תחזינה וקסם לא תקסמנה עוד והצלתי את עמי מידכן וידעתן כי אני יהוה׃"));
hebsuperobject.biblemap.put("b26_14_1", new hebsuperobject(26,14,1,"ויבוא אלי אנשים מזקני ישראל וישבו לפני׃"));
