hebsuperobject.biblemap.put("b26_14_14", new hebsuperobject(26,14,14,"והיו שלשת האנשים האלה בתוכה נח דנאל ואיוב המה בצדקתם ינצלו נפשם נאם אדני יהוה׃"));
hebsuperobject.biblemap.put("b26_14_15", new hebsuperobject(26,14,15,"לו חיה רעה אעביר בארץ ושכלתה והיתה שממה מבלי עובר מפני החיה׃"));
