hebsuperobject.biblemap.put("b26_14_22", new hebsuperobject(26,14,22,"והנה נותרה בה פלטה המוצאים בנים ובנות הנם יוצאים אליכם וראיתם את דרכם ואת עלילותם ונחמתם על הרעה אשר הבאתי על ירושלם את כל אשר הבאתי עליה׃"));
hebsuperobject.biblemap.put("b26_14_23", new hebsuperobject(26,14,23,"ונחמו אתכם כי תראו את דרכם ואת עלילותם וידעתם כי לא חנם עשיתי את כל אשר עשיתי בה נאם אדני יהוה׃"));
