hebsuperobject.biblemap.put("b26_15_7", new hebsuperobject(26,15,7,"ונתתי את פני בהם מהאש יצאו והאש תאכלם וידעתם כי אני יהוה בשומי את פני בהם׃"));
hebsuperobject.biblemap.put("b26_15_8", new hebsuperobject(26,15,8,"ונתתי את הארץ שממה יען מעלו מעל נאם אדני יהוה׃"));
