hebsuperobject.biblemap.put("b26_16_3", new hebsuperobject(26,16,3,"ואמרת כה אמר אדני יהוה לירושלם מכרתיך ומלדתיך מארץ הכנעני אביך האמרי ואמך חתית׃"));
hebsuperobject.biblemap.put("b26_16_4", new hebsuperobject(26,16,4,"ומולדותיך ביום הולדת אתך לא כרת שרך ובמים לא רחצת למשעי והמלח לא המלחת והחתל לא חתלת׃"));
hebsuperobject.biblemap.put("b26_16_5", new hebsuperobject(26,16,5,"לא חסה עליך עין לעשות לך אחת מאלה לחמלה עליך ותשלכי אל פני השדה בגעל נפשך ביום הלדת אתך׃"));
hebsuperobject.biblemap.put("b26_16_6", new hebsuperobject(26,16,6,"ואעבר עליך ואראך מתבוססת בדמיך ואמר לך בדמיך חיי ואמר לך בדמיך חיי׃"));
