hebsuperobject.biblemap.put("b26_16_8", new hebsuperobject(26,16,8,"ואעבר עליך ואראך והנה עתך עת דדים ואפרש כנפי עליך ואכסה ערותך ואשבע לך ואבוא בברית אתך נאם אדני יהוה ותהיי לי׃"));
hebsuperobject.biblemap.put("b26_16_9", new hebsuperobject(26,16,9,"וארחצך במים ואשטף דמיך מעליך ואסכך בשמן׃"));
hebsuperobject.biblemap.put("b26_16_10", new hebsuperobject(26,16,10,"ואלבישך רקמה ואנעלך תחש ואחבשך בשש ואכסך משי׃"));
