hebsuperobject.biblemap.put("b26_16_18", new hebsuperobject(26,16,18,"ותקחי את בגדי רקמתך ותכסים ושמני וקטרתי נתתי לפניהם׃"));
hebsuperobject.biblemap.put("b26_16_19", new hebsuperobject(26,16,19,"ולחמי אשר נתתי לך סלת ושמן ודבש האכלתיך ונתתיהו לפניהם לריח ניחח ויהי נאם אדני יהוה׃"));
