hebsuperobject.biblemap.put("b26_29_16", new hebsuperobject(26,29,16,"ולא יהיה עוד לבית ישראל למבטח מזכיר עון בפנותם אחריהם וידעו כי אני אדני יהוה׃"));
hebsuperobject.biblemap.put("b26_29_17", new hebsuperobject(26,29,17,"ויהי בעשרים ושבע שנה בראשון באחד לחדש היה דבר יהוה אלי לאמר׃"));
