hebsuperobject.biblemap.put("b26_29_20", new hebsuperobject(26,29,20,"פעלתו אשר עבד בה נתתי לו את ארץ מצרים אשר עשו לי נאם אדני יהוה׃"));
hebsuperobject.biblemap.put("b26_29_21", new hebsuperobject(26,29,21,"ביום ההוא אצמיח קרן לבית ישראל ולך אתן פתחון פה בתוכם וידעו כי אני יהוה׃"));
hebsuperobject.biblemap.put("b26_30_1", new hebsuperobject(26,30,1,"ויהי דבר יהוה אלי לאמר׃"));
