hebsuperobject.biblemap.put("b26_30_9", new hebsuperobject(26,30,9,"ביום ההוא יצאו מלאכים מלפני בצים להחריד את כוש בטח והיתה חלחלה בהם ביום מצרים כי הנה באה׃"));
hebsuperobject.biblemap.put("b26_30_10", new hebsuperobject(26,30,10,"כה אמר אדני יהוה והשבתי את המון מצרים ביד נבוכדראצר מלך בבל׃"));
