hebsuperobject.biblemap.put("b26_30_12", new hebsuperobject(26,30,12,"ונתתי יארים חרבה ומכרתי את הארץ ביד רעים והשמתי ארץ ומלאה ביד זרים אני יהוה דברתי׃"));
