hebsuperobject.biblemap.put("b26_32_17", new hebsuperobject(26,32,17,"ויהי בשתי עשרה שנה בחמשה עשר לחדש היה דבר יהוה אלי לאמר׃"));
hebsuperobject.biblemap.put("b26_32_18", new hebsuperobject(26,32,18,"בן אדם נהה על המון מצרים והורדהו אותה ובנות גוים אדרם אל ארץ תחתיות את יורדי בור׃"));
