hebsuperobject.biblemap.put("b26_33_6", new hebsuperobject(26,33,6,"והצפה כי יראה את החרב באה ולא תקע בשופר והעם לא נזהר ותבוא חרב ותקח מהם נפש הוא בעונו נלקח ודמו מיד הצפה אדרש׃"));
hebsuperobject.biblemap.put("b26_33_7", new hebsuperobject(26,33,7,"ואתה בן אדם צפה נתתיך לבית ישראל ושמעת מפי דבר והזהרת אתם ממני׃"));
