hebsuperobject.biblemap.put("b26_33_25", new hebsuperobject(26,33,25,"לכן אמר אלהם כה אמר אדני יהוה על הדם תאכלו ועינכם תשאו אל גלוליכם ודם תשפכו והארץ תירשו׃"));
