hebsuperobject.biblemap.put("b26_35_11", new hebsuperobject(26,35,11,"לכן חי אני נאם אדני יהוה ועשיתי כאפך וכקנאתך אשר עשיתה משנאתיך בם ונודעתי בם כאשר אשפטך׃"));
hebsuperobject.biblemap.put("b26_35_12", new hebsuperobject(26,35,12,"וידעת כי אני יהוה שמעתי את כל נאצותיך אשר אמרת על הרי ישראל לאמר שממה לנו נתנו לאכלה׃"));
hebsuperobject.biblemap.put("b26_35_13", new hebsuperobject(26,35,13,"ותגדילו עלי בפיכם והעתרתם עלי דבריכם אני שמעתי׃"));
hebsuperobject.biblemap.put("b26_35_14", new hebsuperobject(26,35,14,"כה אמר אדני יהוה כשמח כל הארץ שממה אעשה לך׃"));
hebsuperobject.biblemap.put("b26_35_15", new hebsuperobject(26,35,15,"כשמחתך לנחלת בית ישראל על אשר שממה כן אעשה לך שממה תהיה הר שעיר וכל אדום כלה וידעו כי אני יהוה׃"));
hebsuperobject.biblemap.put("b26_36_1", new hebsuperobject(26,36,1,"ואתה בן אדם הנבא אל הרי ישראל ואמרת הרי ישראל שמעו דבר יהוה׃"));
hebsuperobject.biblemap.put("b26_36_2", new hebsuperobject(26,36,2,"כה אמר אדני יהוה יען אמר האויב עליכם האח ובמות עולם למורשה היתה לנו׃"));
hebsuperobject.biblemap.put("b26_36_3", new hebsuperobject(26,36,3,"לכן הנבא ואמרת כה אמר אדני יהוה יען ביען שמות ושאף אתכם מסביב להיותכם מורשה לשארית הגוים ותעלו על שפת לשון ודבת עם׃"));
hebsuperobject.biblemap.put("b26_36_4", new hebsuperobject(26,36,4,"לכן הרי ישראל שמעו דבר אדני יהוה כה אמר אדני יהוה להרים ולגבעות לאפיקים ולגאיות ולחרבות השממות ולערים הנעזבות אשר היו לבז וללעג לשארית הגוים אשר מסביב׃"));
hebsuperobject.biblemap.put("b26_36_5", new hebsuperobject(26,36,5,"לכן כה אמר אדני יהוה אם לא באש קנאתי דברתי על שארית הגוים ועל אדום כלא אשר נתנו את ארצי להם למורשה בשמחת כל לבב בשאט נפש למען מגרשה לבז׃"));
hebsuperobject.biblemap.put("b26_36_6", new hebsuperobject(26,36,6,"לכן הנבא על אדמת ישראל ואמרת להרים ולגבעות לאפיקים ולגאיות כה אמר אדני יהוה הנני בקנאתי ובחמתי דברתי יען כלמת גוים נשאתם׃"));
hebsuperobject.biblemap.put("b26_36_7", new hebsuperobject(26,36,7,"לכן כה אמר אדני יהוה אני נשאתי את ידי אם לא הגוים אשר לכם מסביב המה כלמתם ישאו׃"));
hebsuperobject.biblemap.put("b26_36_8", new hebsuperobject(26,36,8,"ואתם הרי ישראל ענפכם תתנו ופריכם תשאו לעמי ישראל כי קרבו לבוא׃"));
hebsuperobject.biblemap.put("b26_36_9", new hebsuperobject(26,36,9,"כי הנני אליכם ופניתי אליכם ונעבדתם ונזרעתם׃"));
hebsuperobject.biblemap.put("b26_36_10", new hebsuperobject(26,36,10,"והרביתי עליכם אדם כל בית ישראל כלה ונשבו הערים והחרבות תבנינה׃"));
hebsuperobject.biblemap.put("b26_36_11", new hebsuperobject(26,36,11,"והרביתי עליכם אדם ובהמה ורבו ופרו והושבתי אתכם כקדמותיכם והיטבתי מראשתיכם וידעתם כי אני יהוה׃"));
hebsuperobject.biblemap.put("b26_36_12", new hebsuperobject(26,36,12,"והולכתי עליכם אדם את עמי ישראל וירשוך והיית להם לנחלה ולא תוסף עוד לשכלם׃"));
hebsuperobject.biblemap.put("b26_36_13", new hebsuperobject(26,36,13,"כה אמר אדני יהוה יען אמרים לכם אכלת אדם אתי ומשכלת גויך היית׃"));
hebsuperobject.biblemap.put("b26_36_14", new hebsuperobject(26,36,14,"לכן אדם לא תאכלי עוד וגויך לא תכשלי עוד נאם אדני יהוה׃"));
hebsuperobject.biblemap.put("b26_36_15", new hebsuperobject(26,36,15,"ולא אשמיע אליך עוד כלמת הגוים וחרפת עמים לא תשאי עוד וגויך לא תכשלי עוד נאם אדני יהוה׃"));
hebsuperobject.biblemap.put("b26_36_16", new hebsuperobject(26,36,16,"ויהי דבר יהוה אלי לאמר׃"));
hebsuperobject.biblemap.put("b26_36_17", new hebsuperobject(26,36,17,"בן אדם בית ישראל ישבים על אדמתם ויטמאו אותה בדרכם ובעלילותם כטמאת הנדה היתה דרכם לפני׃"));
hebsuperobject.biblemap.put("b26_36_18", new hebsuperobject(26,36,18,"ואשפך חמתי עליהם על הדם אשר שפכו על הארץ ובגלוליהם טמאוה׃"));
hebsuperobject.biblemap.put("b26_36_19", new hebsuperobject(26,36,19,"ואפיץ אתם בגוים ויזרו בארצות כדרכם וכעלילותם שפטתים׃"));
hebsuperobject.biblemap.put("b26_36_20", new hebsuperobject(26,36,20,"ויבוא אל הגוים אשר באו שם ויחללו את שם קדשי באמר להם עם יהוה אלה ומארצו יצאו׃"));
hebsuperobject.biblemap.put("b26_36_21", new hebsuperobject(26,36,21,"ואחמל על שם קדשי אשר חללוהו בית ישראל בגוים אשר באו שמה׃"));
hebsuperobject.biblemap.put("b26_36_22", new hebsuperobject(26,36,22,"לכן אמר לבית ישראל כה אמר אדני יהוה לא למענכם אני עשה בית ישראל כי אם לשם קדשי אשר חללתם בגוים אשר באתם שם׃"));
hebsuperobject.biblemap.put("b26_36_23", new hebsuperobject(26,36,23,"וקדשתי את שמי הגדול המחלל בגוים אשר חללתם בתוכם וידעו הגוים כי אני יהוה נאם אדני יהוה בהקדשי בכם לעיניהם׃"));
hebsuperobject.biblemap.put("b26_36_24", new hebsuperobject(26,36,24,"ולקחתי אתכם מן הגוים וקבצתי אתכם מכל הארצות והבאתי אתכם אל אדמתכם׃"));
hebsuperobject.biblemap.put("b26_36_25", new hebsuperobject(26,36,25,"וזרקתי עליכם מים טהורים וטהרתם מכל טמאותיכם ומכל גלוליכם אטהר אתכם׃"));
hebsuperobject.biblemap.put("b26_36_26", new hebsuperobject(26,36,26,"ונתתי לכם לב חדש ורוח חדשה אתן בקרבכם והסרתי את לב האבן מבשרכם ונתתי לכם לב בשר׃"));
hebsuperobject.biblemap.put("b26_36_27", new hebsuperobject(26,36,27,"ואת רוחי אתן בקרבכם ועשיתי את אשר בחקי תלכו ומשפטי תשמרו ועשיתם׃"));
hebsuperobject.biblemap.put("b26_36_28", new hebsuperobject(26,36,28,"וישבתם בארץ אשר נתתי לאבתיכם והייתם לי לעם ואנכי אהיה לכם לאלהים׃"));
hebsuperobject.biblemap.put("b26_36_29", new hebsuperobject(26,36,29,"והושעתי אתכם מכל טמאותיכם וקראתי אל הדגן והרביתי אתו ולא אתן עליכם רעב׃"));
hebsuperobject.biblemap.put("b26_36_30", new hebsuperobject(26,36,30,"והרביתי את פרי העץ ותנובת השדה למען אשר לא תקחו עוד חרפת רעב בגוים׃"));
hebsuperobject.biblemap.put("b26_36_31", new hebsuperobject(26,36,31,"וזכרתם את דרכיכם הרעים ומעלליכם אשר לא טובים ונקטתם בפניכם על עונתיכם ועל תועבתיכם׃"));
hebsuperobject.biblemap.put("b26_36_32", new hebsuperobject(26,36,32,"לא למענכם אני עשה נאם אדני יהוה יודע לכם בושו והכלמו מדרכיכם בית ישראל׃"));
hebsuperobject.biblemap.put("b26_36_33", new hebsuperobject(26,36,33,"כה אמר אדני יהוה ביום טהרי אתכם מכל עונותיכם והושבתי את הערים ונבנו החרבות׃"));
hebsuperobject.biblemap.put("b26_36_34", new hebsuperobject(26,36,34,"והארץ הנשמה תעבד תחת אשר היתה שממה לעיני כל עובר׃"));
hebsuperobject.biblemap.put("b26_36_35", new hebsuperobject(26,36,35,"ואמרו הארץ הלזו הנשמה היתה כגן עדן והערים החרבות והנשמות והנהרסות בצורות ישבו׃"));
hebsuperobject.biblemap.put("b26_36_36", new hebsuperobject(26,36,36,"וידעו הגוים אשר ישארו סביבותיכם כי אני יהוה בניתי הנהרסות נטעתי הנשמה אני יהוה דברתי ועשיתי׃"));
hebsuperobject.biblemap.put("b26_36_37", new hebsuperobject(26,36,37,"כה אמר אדני יהוה עוד זאת אדרש לבית ישראל לעשות להם ארבה אתם כצאן אדם׃"));
hebsuperobject.biblemap.put("b26_36_38", new hebsuperobject(26,36,38,"כצאן קדשים כצאן ירושלם במועדיה כן תהיינה הערים החרבות מלאות צאן אדם וידעו כי אני יהוה׃"));
hebsuperobject.biblemap.put("b26_37_1", new hebsuperobject(26,37,1,"היתה עלי יד יהוה ויוצאני ברוח יהוה ויניחני בתוך הבקעה והיא מלאה עצמות׃"));
hebsuperobject.biblemap.put("b26_37_2", new hebsuperobject(26,37,2,"והעבירני עליהם סביב סביב והנה רבות מאד על פני הבקעה והנה יבשות מאד׃"));
hebsuperobject.biblemap.put("b26_37_3", new hebsuperobject(26,37,3,"ויאמר אלי בן אדם התחיינה העצמות האלה ואמר אדני יהוה אתה ידעת׃"));
hebsuperobject.biblemap.put("b26_37_4", new hebsuperobject(26,37,4,"ויאמר אלי הנבא על העצמות האלה ואמרת אליהם העצמות היבשות שמעו דבר יהוה׃"));
hebsuperobject.biblemap.put("b26_37_5", new hebsuperobject(26,37,5,"כה אמר אדני יהוה לעצמות האלה הנה אני מביא בכם רוח וחייתם׃"));
hebsuperobject.biblemap.put("b26_37_6", new hebsuperobject(26,37,6,"ונתתי עליכם גדים והעלתי עליכם בשר וקרמתי עליכם עור ונתתי בכם רוח וחייתם וידעתם כי אני יהוה׃"));
hebsuperobject.biblemap.put("b26_37_7", new hebsuperobject(26,37,7,"ונבאתי כאשר צויתי ויהי קול כהנבאי והנה רעש ותקרבו עצמות עצם אל עצמו׃"));
hebsuperobject.biblemap.put("b26_37_8", new hebsuperobject(26,37,8,"וראיתי והנה עליהם גדים ובשר עלה ויקרם עליהם עור מלמעלה ורוח אין בהם׃"));
hebsuperobject.biblemap.put("b26_37_9", new hebsuperobject(26,37,9,"ויאמר אלי הנבא אל הרוח הנבא בן אדם ואמרת אל הרוח כה אמר אדני יהוה מארבע רוחות באי הרוח ופחי בהרוגים האלה ויחיו׃"));
hebsuperobject.biblemap.put("b26_37_10", new hebsuperobject(26,37,10,"והנבאתי כאשר צוני ותבוא בהם הרוח ויחיו ויעמדו על רגליהם חיל גדול מאד מאד׃"));
hebsuperobject.biblemap.put("b26_37_11", new hebsuperobject(26,37,11,"ויאמר אלי בן אדם העצמות האלה כל בית ישראל המה הנה אמרים יבשו עצמותינו ואבדה תקותנו נגזרנו לנו׃"));
hebsuperobject.biblemap.put("b26_37_12", new hebsuperobject(26,37,12,"לכן הנבא ואמרת אליהם כה אמר אדני יהוה הנה אני פתח את קברותיכם והעליתי אתכם מקברותיכם עמי והבאתי אתכם אל אדמת ישראל׃"));
hebsuperobject.biblemap.put("b26_37_13", new hebsuperobject(26,37,13,"וידעתם כי אני יהוה בפתחי את קברותיכם ובהעלותי אתכם מקברותיכם עמי׃"));
hebsuperobject.biblemap.put("b26_37_14", new hebsuperobject(26,37,14,"ונתתי רוחי בכם וחייתם והנחתי אתכם על אדמתכם וידעתם כי אני יהוה דברתי ועשיתי נאם יהוה׃"));
hebsuperobject.biblemap.put("b26_37_15", new hebsuperobject(26,37,15,"ויהי דבר יהוה אלי לאמר׃"));
hebsuperobject.biblemap.put("b26_37_16", new hebsuperobject(26,37,16,"ואתה בן אדם קח לך עץ אחד וכתב עליו ליהודה ולבני ישראל חברו ולקח עץ אחד וכתוב עליו ליוסף עץ אפרים וכל בית ישראל חברו׃"));
hebsuperobject.biblemap.put("b26_37_17", new hebsuperobject(26,37,17,"וקרב אתם אחד אל אחד לך לעץ אחד והיו לאחדים בידך׃"));
hebsuperobject.biblemap.put("b26_37_18", new hebsuperobject(26,37,18,"וכאשר יאמרו אליך בני עמך לאמר הלוא תגיד לנו מה אלה לך׃"));
hebsuperobject.biblemap.put("b26_37_19", new hebsuperobject(26,37,19,"דבר אלהם כה אמר אדני יהוה הנה אני לקח את עץ יוסף אשר ביד אפרים ושבטי ישראל חברו ונתתי אותם עליו את עץ יהודה ועשיתם לעץ אחד והיו אחד בידי׃"));
hebsuperobject.biblemap.put("b26_37_20", new hebsuperobject(26,37,20,"והיו העצים אשר תכתב עליהם בידך לעיניהם׃"));
hebsuperobject.biblemap.put("b26_37_21", new hebsuperobject(26,37,21,"ודבר אליהם כה אמר אדני יהוה הנה אני לקח את בני ישראל מבין הגוים אשר הלכו שם וקבצתי אתם מסביב והבאתי אותם אל אדמתם׃"));
hebsuperobject.biblemap.put("b26_37_22", new hebsuperobject(26,37,22,"ועשיתי אתם לגוי אחד בארץ בהרי ישראל ומלך אחד יהיה לכלם למלך ולא יהיה עוד לשני גוים ולא יחצו עוד לשתי ממלכות עוד׃"));
hebsuperobject.biblemap.put("b26_37_23", new hebsuperobject(26,37,23,"ולא יטמאו עוד בגלוליהם ובשקוציהם ובכל פשעיהם והושעתי אתם מכל מושבתיהם אשר חטאו בהם וטהרתי אותם והיו לי לעם ואני אהיה להם לאלהים׃"));
hebsuperobject.biblemap.put("b26_37_24", new hebsuperobject(26,37,24,"ועבדי דוד מלך עליהם ורועה אחד יהיה לכלם ובמשפטי ילכו וחקתי ישמרו ועשו אותם׃"));
hebsuperobject.biblemap.put("b26_37_25", new hebsuperobject(26,37,25,"וישבו על הארץ אשר נתתי לעבדי ליעקב אשר ישבו בה אבותיכם וישבו עליה המה ובניהם ובני בניהם עד עולם ודוד עבדי נשיא להם לעולם׃"));
hebsuperobject.biblemap.put("b26_37_26", new hebsuperobject(26,37,26,"וכרתי להם ברית שלום ברית עולם יהיה אותם ונתתים והרביתי אותם ונתתי את מקדשי בתוכם לעולם׃"));
hebsuperobject.biblemap.put("b26_37_27", new hebsuperobject(26,37,27,"והיה משכני עליהם והייתי להם לאלהים והמה יהיו לי לעם׃"));
hebsuperobject.biblemap.put("b26_37_28", new hebsuperobject(26,37,28,"וידעו הגוים כי אני יהוה מקדש את ישראל בהיות מקדשי בתוכם לעולם׃"));
hebsuperobject.biblemap.put("b26_38_1", new hebsuperobject(26,38,1,"ויהי דבר יהוה אלי לאמר׃"));
hebsuperobject.biblemap.put("b26_38_2", new hebsuperobject(26,38,2,"בן אדם שים פניך אל גוג ארץ המגוג נשיא ראש משך ותבל והנבא עליו׃"));
hebsuperobject.biblemap.put("b26_38_3", new hebsuperobject(26,38,3,"ואמרת כה אמר אדני יהוה הנני אליך גוג נשיא ראש משך ותבל׃"));
hebsuperobject.biblemap.put("b26_38_4", new hebsuperobject(26,38,4,"ושובבתיך ונתתי חחים בלחייך והוצאתי אותך ואת כל חילך סוסים ופרשים לבשי מכלול כלם קהל רב צנה ומגן תפשי חרבות כלם׃"));
hebsuperobject.biblemap.put("b26_38_5", new hebsuperobject(26,38,5,"פרס כוש ופוט אתם כלם מגן וכובע׃"));
hebsuperobject.biblemap.put("b26_38_6", new hebsuperobject(26,38,6,"גמר וכל אגפיה בית תוגרמה ירכתי צפון ואת כל אגפיו עמים רבים אתך׃"));
hebsuperobject.biblemap.put("b26_38_7", new hebsuperobject(26,38,7,"הכן והכן לך אתה וכל קהלך הנקהלים עליך והיית להם למשמר׃"));
