hebsuperobject.biblemap.put("b26_43_20", new hebsuperobject(26,43,20,"ולקחת מדמו ונתתה על ארבע קרנתיו ואל ארבע פנות העזרה ואל הגבול סביב וחטאת אותו וכפרתהו׃"));
hebsuperobject.biblemap.put("b26_43_21", new hebsuperobject(26,43,21,"ולקחת את הפר החטאת ושרפו במפקד הבית מחוץ למקדש׃"));
hebsuperobject.biblemap.put("b26_43_22", new hebsuperobject(26,43,22,"וביום השני תקריב שעיר עזים תמים לחטאת וחטאו את המזבח כאשר חטאו בפר׃"));
hebsuperobject.biblemap.put("b26_43_23", new hebsuperobject(26,43,23,"בכלותך מחטא תקריב פר בן בקר תמים ואיל מן הצאן תמים׃"));
hebsuperobject.biblemap.put("b26_43_24", new hebsuperobject(26,43,24,"והקרבתם לפני יהוה והשליכו הכהנים עליהם מלח והעלו אותם עלה ליהוה׃"));
hebsuperobject.biblemap.put("b26_43_25", new hebsuperobject(26,43,25,"שבעת ימים תעשה שעיר חטאת ליום ופר בן בקר ואיל מן הצאן תמימים יעשו׃"));
hebsuperobject.biblemap.put("b26_43_26", new hebsuperobject(26,43,26,"שבעת ימים יכפרו את המזבח וטהרו אתו ומלאו ידו׃"));
hebsuperobject.biblemap.put("b26_43_27", new hebsuperobject(26,43,27,"ויכלו את הימים והיה ביום השמיני והלאה יעשו הכהנים על המזבח את עולותיכם ואת שלמיכם ורצאתי אתכם נאם אדני יהוה׃"));
hebsuperobject.biblemap.put("b26_44_1", new hebsuperobject(26,44,1,"וישב אתי דרך שער המקדש החיצון הפנה קדים והוא סגור׃"));
hebsuperobject.biblemap.put("b26_44_2", new hebsuperobject(26,44,2,"ויאמר אלי יהוה השער הזה סגור יהיה לא יפתח ואיש לא יבא בו כי יהוה אלהי ישראל בא בו והיה סגור׃"));
hebsuperobject.biblemap.put("b26_44_3", new hebsuperobject(26,44,3,"את הנשיא נשיא הוא ישב בו לאכול לחם לפני יהוה מדרך אלם השער יבוא ומדרכו יצא׃"));
hebsuperobject.biblemap.put("b26_44_4", new hebsuperobject(26,44,4,"ויביאני דרך שער הצפון אל פני הבית וארא והנה מלא כבוד יהוה את בית יהוה ואפל אל פני׃"));
hebsuperobject.biblemap.put("b26_44_5", new hebsuperobject(26,44,5,"ויאמר אלי יהוה בן אדם שים לבך וראה בעיניך ובאזניך שמע את כל אשר אני מדבר אתך לכל חקות בית יהוה ולכל תורתו ושמת לבך למבוא הבית בכל מוצאי המקדש׃"));
hebsuperobject.biblemap.put("b26_44_6", new hebsuperobject(26,44,6,"ואמרת אל מרי אל בית ישראל כה אמר אדני יהוה רב לכם מכל תועבותיכם בית ישראל׃"));
hebsuperobject.biblemap.put("b26_44_7", new hebsuperobject(26,44,7,"בהביאכם בני נכר ערלי לב וערלי בשר להיות במקדשי לחללו את ביתי בהקריבכם את לחמי חלב ודם ויפרו את בריתי אל כל תועבותיכם׃"));
hebsuperobject.biblemap.put("b26_44_8", new hebsuperobject(26,44,8,"ולא שמרתם משמרת קדשי ותשימון לשמרי משמרתי במקדשי לכם׃"));
hebsuperobject.biblemap.put("b26_44_9", new hebsuperobject(26,44,9,"כה אמר אדני יהוה כל בן נכר ערל לב וערל בשר לא יבוא אל מקדשי לכל בן נכר אשר בתוך בני ישראל׃"));
hebsuperobject.biblemap.put("b26_44_10", new hebsuperobject(26,44,10,"כי אם הלוים אשר רחקו מעלי בתעות ישראל אשר תעו מעלי אחרי גלוליהם ונשאו עונם׃"));
hebsuperobject.biblemap.put("b26_44_11", new hebsuperobject(26,44,11,"והיו במקדשי משרתים פקדות אל שערי הבית ומשרתים את הבית המה ישחטו את העלה ואת הזבח לעם והמה יעמדו לפניהם לשרתם׃"));
hebsuperobject.biblemap.put("b26_44_12", new hebsuperobject(26,44,12,"יען אשר ישרתו אותם לפני גלוליהם והיו לבית ישראל למכשול עון על כן נשאתי ידי עליהם נאם אדני יהוה ונשאו עונם׃"));
hebsuperobject.biblemap.put("b26_44_13", new hebsuperobject(26,44,13,"ולא יגשו אלי לכהן לי ולגשת על כל קדשי אל קדשי הקדשים ונשאו כלמתם ותועבותם אשר עשו׃"));
hebsuperobject.biblemap.put("b26_44_14", new hebsuperobject(26,44,14,"ונתתי אותם שמרי משמרת הבית לכל עבדתו ולכל אשר יעשה בו׃"));
hebsuperobject.biblemap.put("b26_44_15", new hebsuperobject(26,44,15,"והכהנים הלוים בני צדוק אשר שמרו את משמרת מקדשי בתעות בני ישראל מעלי המה יקרבו אלי לשרתני ועמדו לפני להקריב לי חלב ודם נאם אדני יהוה׃"));
hebsuperobject.biblemap.put("b26_44_16", new hebsuperobject(26,44,16,"המה יבאו אל מקדשי והמה יקרבו אל שלחני לשרתני ושמרו את משמרתי׃"));
hebsuperobject.biblemap.put("b26_44_17", new hebsuperobject(26,44,17,"והיה בבואם אל שערי החצר הפנימית בגדי פשתים ילבשו ולא יעלה עליהם צמר בשרתם בשערי החצר הפנימית וביתה׃"));
hebsuperobject.biblemap.put("b26_44_18", new hebsuperobject(26,44,18,"פארי פשתים יהיו על ראשם ומכנסי פשתים יהיו על מתניהם לא יחגרו ביזע׃"));
hebsuperobject.biblemap.put("b26_44_19", new hebsuperobject(26,44,19,"ובצאתם אל החצר החיצונה אל החצר החיצונה אל העם יפשטו את בגדיהם אשר המה משרתם בם והניחו אותם בלשכת הקדש ולבשו בגדים אחרים ולא יקדשו את העם בבגדיהם׃"));
hebsuperobject.biblemap.put("b26_44_20", new hebsuperobject(26,44,20,"וראשם לא יגלחו ופרע לא ישלחו כסום יכסמו את ראשיהם׃"));
hebsuperobject.biblemap.put("b26_44_21", new hebsuperobject(26,44,21,"ויין לא ישתו כל כהן בבואם אל החצר הפנימית׃"));
hebsuperobject.biblemap.put("b26_44_22", new hebsuperobject(26,44,22,"ואלמנה וגרושה לא יקחו להם לנשים כי אם בתולת מזרע בית ישראל והאלמנה אשר תהיה אלמנה מכהן יקחו׃"));
hebsuperobject.biblemap.put("b26_44_23", new hebsuperobject(26,44,23,"ואת עמי יורו בין קדש לחל ובין טמא לטהור יודעם׃"));
hebsuperobject.biblemap.put("b26_44_24", new hebsuperobject(26,44,24,"ועל ריב המה יעמדו לשפט במשפטי ושפטהו ואת תורתי ואת חקתי בכל מועדי ישמרו ואת שבתותי יקדשו׃"));
hebsuperobject.biblemap.put("b26_44_25", new hebsuperobject(26,44,25,"ואל מת אדם לא יבוא לטמאה כי אם לאב ולאם ולבן ולבת לאח ולאחות אשר לא היתה לאיש יטמאו׃"));
hebsuperobject.biblemap.put("b26_44_26", new hebsuperobject(26,44,26,"ואחרי טהרתו שבעת ימים יספרו לו׃"));
hebsuperobject.biblemap.put("b26_44_27", new hebsuperobject(26,44,27,"וביום באו אל הקדש אל החצר הפנימית לשרת בקדש יקריב חטאתו נאם אדני יהוה׃"));
hebsuperobject.biblemap.put("b26_44_28", new hebsuperobject(26,44,28,"והיתה להם לנחלה אני נחלתם ואחזה לא תתנו להם בישראל אני אחזתם׃"));
hebsuperobject.biblemap.put("b26_44_29", new hebsuperobject(26,44,29,"המנחה והחטאת והאשם המה יאכלום וכל חרם בישראל להם יהיה׃"));
hebsuperobject.biblemap.put("b26_44_30", new hebsuperobject(26,44,30,"וראשית כל בכורי כל וכל תרומת כל מכל תרומותיכם לכהנים יהיה וראשית ערסותיכם תתנו לכהן להניח ברכה אל ביתך׃"));
hebsuperobject.biblemap.put("b26_44_31", new hebsuperobject(26,44,31,"כל נבלה וטרפה מן העוף ומן הבהמה לא יאכלו הכהנים׃"));
hebsuperobject.biblemap.put("b26_45_1", new hebsuperobject(26,45,1,"ובהפילכם את הארץ בנחלה תרימו תרומה ליהוה קדש מן הארץ ארך חמשה ועשרים אלף ארך ורחב עשרה אלף קדש הוא בכל גבולה סביב׃"));
hebsuperobject.biblemap.put("b26_45_2", new hebsuperobject(26,45,2,"יהיה מזה אל הקדש חמש מאות בחמש מאות מרבע סביב וחמשים אמה מגרש לו סביב׃"));
hebsuperobject.biblemap.put("b26_45_3", new hebsuperobject(26,45,3,"ומן המדה הזאת תמוד ארך חמש ועשרים אלף ורחב עשרת אלפים ובו יהיה המקדש קדש קדשים׃"));
hebsuperobject.biblemap.put("b26_45_4", new hebsuperobject(26,45,4,"קדש מן הארץ הוא לכהנים משרתי המקדש יהיה הקרבים לשרת את יהוה והיה להם מקום לבתים ומקדש למקדש׃"));
hebsuperobject.biblemap.put("b26_45_5", new hebsuperobject(26,45,5,"וחמשה ועשרים אלף ארך ועשרת אלפים רחב יהיה ללוים משרתי הבית להם לאחזה עשרים לשכת׃"));
hebsuperobject.biblemap.put("b26_45_6", new hebsuperobject(26,45,6,"ואחזת העיר תתנו חמשת אלפים רחב וארך חמשה ועשרים אלף לעמת תרומת הקדש לכל בית ישראל יהיה׃"));
hebsuperobject.biblemap.put("b26_45_7", new hebsuperobject(26,45,7,"ולנשיא מזה ומזה לתרומת הקדש ולאחזת העיר אל פני תרומת הקדש ואל פני אחזת העיר מפאת ים ימה ומפאת קדמה קדימה וארך לעמות אחד החלקים מגבול ים אל גבול קדימה׃"));
hebsuperobject.biblemap.put("b26_45_8", new hebsuperobject(26,45,8,"לארץ יהיה לו לאחזה בישראל ולא יונו עוד נשיאי את עמי והארץ יתנו לבית ישראל לשבטיהם׃"));
hebsuperobject.biblemap.put("b26_45_9", new hebsuperobject(26,45,9,"כה אמר אדני יהוה רב לכם נשיאי ישראל חמס ושד הסירו ומשפט וצדקה עשו הרימו גרשתיכם מעל עמי נאם אדני יהוה׃"));
hebsuperobject.biblemap.put("b26_45_10", new hebsuperobject(26,45,10,"מאזני צדק ואיפת צדק ובת צדק יהי לכם׃"));
hebsuperobject.biblemap.put("b26_45_11", new hebsuperobject(26,45,11,"האיפה והבת תכן אחד יהיה לשאת מעשר החמר הבת ועשירת החמר האיפה אל החמר יהיה מתכנתו׃"));
hebsuperobject.biblemap.put("b26_45_12", new hebsuperobject(26,45,12,"והשקל עשרים גרה עשרים שקלים חמשה ועשרים שקלים עשרה וחמשה שקל המנה יהיה לכם׃"));
hebsuperobject.biblemap.put("b26_45_13", new hebsuperobject(26,45,13,"זאת התרומה אשר תרימו ששית האיפה מחמר החטים וששיתם האיפה מחמר השערים׃"));
hebsuperobject.biblemap.put("b26_45_14", new hebsuperobject(26,45,14,"וחק השמן הבת השמן מעשר הבת מן הכר עשרת הבתים חמר כי עשרת הבתים חמר׃"));
hebsuperobject.biblemap.put("b26_45_15", new hebsuperobject(26,45,15,"ושה אחת מן הצאן מן המאתים ממשקה ישראל למנחה ולעולה ולשלמים לכפר עליהם נאם אדני יהוה׃"));
hebsuperobject.biblemap.put("b26_45_16", new hebsuperobject(26,45,16,"כל העם הארץ יהיו אל התרומה הזאת לנשיא בישראל׃"));
hebsuperobject.biblemap.put("b26_45_17", new hebsuperobject(26,45,17,"ועל הנשיא יהיה העולות והמנחה והנסך בחגים ובחדשים ובשבתות בכל מועדי בית ישראל הוא יעשה את החטאת ואת המנחה ואת העולה ואת השלמים לכפר בעד בית ישראל׃"));
hebsuperobject.biblemap.put("b26_45_18", new hebsuperobject(26,45,18,"כה אמר אדני יהוה בראשון באחד לחדש תקח פר בן בקר תמים וחטאת את המקדש׃"));
hebsuperobject.biblemap.put("b26_45_19", new hebsuperobject(26,45,19,"ולקח הכהן מדם החטאת ונתן אל מזוזת הבית ואל ארבע פנות העזרה למזבח ועל מזוזת שער החצר הפנימית׃"));
hebsuperobject.biblemap.put("b26_45_20", new hebsuperobject(26,45,20,"וכן תעשה בשבעה בחדש מאיש שגה ומפתי וכפרתם את הבית׃"));
hebsuperobject.biblemap.put("b26_45_21", new hebsuperobject(26,45,21,"בראשון בארבעה עשר יום לחדש יהיה לכם הפסח חג שבעות ימים מצות יאכל׃"));
hebsuperobject.biblemap.put("b26_45_22", new hebsuperobject(26,45,22,"ועשה הנשיא ביום ההוא בעדו ובעד כל עם הארץ פר חטאת׃"));
hebsuperobject.biblemap.put("b26_45_23", new hebsuperobject(26,45,23,"ושבעת ימי החג יעשה עולה ליהוה שבעת פרים ושבעת אילים תמימם ליום שבעת הימים וחטאת שעיר עזים ליום׃"));
hebsuperobject.biblemap.put("b26_45_24", new hebsuperobject(26,45,24,"ומנחה איפה לפר ואיפה לאיל יעשה ושמן הין לאיפה׃"));
hebsuperobject.biblemap.put("b26_45_25", new hebsuperobject(26,45,25,"בשביעי בחמשה עשר יום לחדש בחג יעשה כאלה שבעת הימים כחטאת כעלה וכמנחה וכשמן׃"));
hebsuperobject.biblemap.put("b26_46_1", new hebsuperobject(26,46,1,"כה אמר אדני יהוה שער החצר הפנימית הפנה קדים יהיה סגור ששת ימי המעשה וביום השבת יפתח וביום החדש יפתח׃"));
hebsuperobject.biblemap.put("b26_46_2", new hebsuperobject(26,46,2,"ובא הנשיא דרך אולם השער מחוץ ועמד על מזוזת השער ועשו הכהנים את עולתו ואת שלמיו והשתחוה על מפתן השער ויצא והשער לא יסגר עד הערב׃"));
hebsuperobject.biblemap.put("b26_46_3", new hebsuperobject(26,46,3,"והשתחוו עם הארץ פתח השער ההוא בשבתות ובחדשים לפני יהוה׃"));
hebsuperobject.biblemap.put("b26_46_4", new hebsuperobject(26,46,4,"והעלה אשר יקרב הנשיא ליהוה ביום השבת ששה כבשים תמימם ואיל תמים׃"));
hebsuperobject.biblemap.put("b26_46_5", new hebsuperobject(26,46,5,"ומנחה איפה לאיל ולכבשים מנחה מתת ידו ושמן הין לאיפה׃"));
hebsuperobject.biblemap.put("b26_46_6", new hebsuperobject(26,46,6,"וביום החדש פר בן בקר תמימם וששת כבשם ואיל תמימם יהיו׃"));
hebsuperobject.biblemap.put("b26_46_7", new hebsuperobject(26,46,7,"ואיפה לפר ואיפה לאיל יעשה מנחה ולכבשים כאשר תשיג ידו ושמן הין לאיפה׃"));
hebsuperobject.biblemap.put("b26_46_8", new hebsuperobject(26,46,8,"ובבוא הנשיא דרך אולם השער יבוא ובדרכו יצא׃"));
hebsuperobject.biblemap.put("b26_46_9", new hebsuperobject(26,46,9,"ובבוא עם הארץ לפני יהוה במועדים הבא דרך שער צפון להשתחות יצא דרך שער נגב והבא דרך שער נגב יצא דרך שער צפונה לא ישוב דרך השער אשר בא בו כי נכחו יצאו׃"));
hebsuperobject.biblemap.put("b26_46_10", new hebsuperobject(26,46,10,"והנשיא בתוכם בבואם יבוא ובצאתם יצאו׃"));
hebsuperobject.biblemap.put("b26_46_11", new hebsuperobject(26,46,11,"ובחגים ובמועדים תהיה המנחה איפה לפר ואיפה לאיל ולכבשים מתת ידו ושמן הין לאיפה׃"));
hebsuperobject.biblemap.put("b26_46_12", new hebsuperobject(26,46,12,"וכי יעשה הנשיא נדבה עולה או שלמים נדבה ליהוה ופתח לו את השער הפנה קדים ועשה את עלתו ואת שלמיו כאשר יעשה ביום השבת ויצא וסגר את השער אחרי צאתו׃"));
hebsuperobject.biblemap.put("b26_46_13", new hebsuperobject(26,46,13,"וכבש בן שנתו תמים תעשה עולה ליום ליהוה בבקר בבקר תעשה אתו׃"));
hebsuperobject.biblemap.put("b26_46_14", new hebsuperobject(26,46,14,"ומנחה תעשה עליו בבקר בבקר ששית האיפה ושמן שלישית ההין לרס את הסלת מנחה ליהוה חקות עולם תמיד׃"));
hebsuperobject.biblemap.put("b26_46_15", new hebsuperobject(26,46,15,"ועשו את הכבש ואת המנחה ואת השמן בבקר בבקר עולת תמיד׃"));
