hebsuperobject.biblemap.put("b26_46_18", new hebsuperobject(26,46,18,"ולא יקח הנשיא מנחלת העם להונתם מאחזתם מאחזתו ינחל את בניו למען אשר לא יפצו עמי איש מאחזתו׃"));
